$(function(){$(".btn-edit-function").click(function(){var a=$(this).data("name"),t=$(this).data("args"),o=$(this).data("code"),n=$(this).data("url"),d=$(this).data("desc")
$(".modal-body #name").val(a),$(".modal-body #args").val(t),$(".modal-body #code").val(o),$(".modal-body #url").val(n),$(".modal-body #description").val(d)}),$(".submit-update-function").click(function(){var a=$(".modal-body #name").val(),t=$(".modal-body #args").val(),o=$(".modal-body #code").val(),n=$(".modal-body #description").val(),d=$(".modal-body #url").val(),l={name:a,args:t,description:n,code:o}
$.ajax({type:"PUT",url:d,data:JSON.stringify(l),contentType:"application/json; charset=utf-8",success:function(){alert("Function Updated"),location.reload()},error:function(){alert("Update Failed")}})}),$(".btn-run-function").click(function(){var a=($(this).data("name"),$(this).data("apiurl")),t=$("#func-input-args").val(),o=JSON.parse(t)
$.ajax({type:"GET",url:a,data:o,contentType:"application/json; charset=utf-8",success:function(a){$("#func-output").val(a.result),location.reload()},error:function(){alert("Evaluation Failed!")}})})})
